import React from 'react';
import Lottie from 'react-lottie';
import animationData from '../assets/girl-animation.json';
import './Home.css';

const Home = () => {
  const defaultOptions = {
    loop: true,
    autoplay: true,
    animationData: animationData,
    rendererSettings: {
      preserveAspectRatio: 'xMidYMid slice'
    }
  };

  return (
    <section id="home" className="home">
      <div className="home-content">
        <h1>Hi, I'm Aditi Garg</h1>
        <h3>4th Year B.Tech Student (ECE)</h3>
        <p>
          A final year Electronics and Communication Engineering student with a passion for software development and problem-solving. Seeking opportunities to apply my skills in a challenging and growth-oriented environment.
        </p>
        <div className="social-links">
          <a href="https://github.com/AditiGarg5" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-github"></i>
          </a>
          <a href="https://www.linkedin.com/in/aditi-garg-517277227" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-linkedin"></i>
          </a>
          <a href="mailto:aditigarg2003@gmail.com">
            <i className="fas fa-envelope"></i>
          </a>
        </div>
      </div>
      <div className="home-animation">
        <Lottie options={defaultOptions} height={500} width={500} />
      </div>
    </section>
  );
};

export default Home;
